import { Routes, Route, Link } from "react-router-dom";


const header =()=> {
    return ( 

        <div className="header">
            <h1>ARTFOLLIS</h1>
        <Link to="/inscription">Inscription</Link>
        <Link to="/connexion">Connexion</Link>
        <Link to="/">Accueil</Link>
        </div>
     );
}

export default header ;
